"""# **Opcion 1.Uso de ChatPromptTemplate y feedback_key='equality'**

# **Definicion output_schema**
"""

class EqualityResult(TypedDict):
  are_equal: bool

"""# **Definicion de Prompt**"""

prompt = ChatPromptTemplate([
    ("system", "You are an expert at determining if two objects are equal. When comparing, ignore:  - Uppercase vs lowercase  - Accents/diacritics (e.g.,  = a,  = e)  - Extra spaces  Only consider meaningful text differences."),
    ("human", "Are these two equal? {{inputs}} {{outputs}}"),
], template_format="mustache")

"""# **Cargar datasets**"""

golden = pd.read_excel("/content/drive/MyDrive/Colab Notebooks/dataSetComprobado.xlsx")
n8n_output = pd.read_excel("/content/drive/MyDrive/Colab Notebooks/extracciones_VALIDADAS.xlsx")

"""# **Unir por columna 'file'**"""

merged = pd.merge(golden, n8n_output, on="file", suffixes=("_expected", "_n8n"))

"""# **Crear evaluador**"""

accuracy_evaluator = create_llm_as_judge(
    prompt=prompt,
    model="gpt-4.1-mini",
    output_schema=EqualityResult,
    feedback_key="equality",
)

"""# **Definir columnas a validar**"""

columns_to_compare = [
    "Radicado", "Demandado", "Demandante",
    "Fecha De Recibido", "Fecha De Sentencia", "Tipo De Proceso"
]

def normalize_fecha(value) -> str:
    if value is None or value == "":
        return ""

    # Convertir a string base
    s = str(value).strip()

    # Limpiar caracteres invisibles comunes en Excel
    s = s.replace("\u00a0", " ")   # nbsp
    s = s.replace("\u200b", "")    # zero-width
    s = re.sub(r"\s+", " ", s)

    # Intentar parsear como fecha (maneja Timestamp, datetime, string)
    try:
        dt = pd.to_datetime(s, dayfirst=True, errors="raise")
        return dt.strftime("%d/%m/%Y")
    except Exception:
        return s

"""# **Envio de informacion extraida al evaluador fila por fila**"""

results = []

for _, row in merged.iterrows():
    file = row["file"]
    row_result = {"file": file, "evals": {}}

    for col in columns_to_compare:
        expected_raw = row.get(f"{col}_expected", "")
        obtained_raw = row.get(f"{col}_n8n", "")

        if col in ["Fecha De Sentencia", "Fecha De Recibido"]:
          expected = normalize_fecha(expected_raw)
          obtained = normalize_fecha(obtained_raw)
        else:
          expected = str(expected_raw)
          obtained = str(obtained_raw)

        eval_result = accuracy_evaluator(
            inputs=expected,
            outputs=obtained
        )

        row_result["evals"][col] = eval_result

    results.append(row_result)

"""# **Generar archivo Excel con resultados**"""

def generar_excel_estadisticas(results, file_excel="estadisticas_llm.xlsx"):
    import pandas as pd
    from openpyxl import load_workbook
    from openpyxl.chart import BarChart, Reference, PieChart
    from openpyxl.chart.label import DataLabelList
    from google.colab import files  # si lo corres en Colab

    # =========================
    # Convertir results  DataFrame
    # =========================
    rows = []
    for r in results:
        row = {"file": r["file"]}
        for col, eval_ in r["evals"].items():
            if isinstance(eval_, dict):
                row[col] = eval_.get("are_equal", None)
            else:
                row[col] = None
        rows.append(row)

    df = pd.DataFrame(rows)

    # =========================
    # Estadsticas por archivo
    # =========================
    df["Aciertos"] = df.drop(columns=["file"]).sum(axis=1)
    df["Fallos"] = df.drop(columns=["file"]).shape[1] - 1 - df["Aciertos"]  # -1 por "file"

    # =========================
    # Ranking de archivos con ms fallos
    # =========================
    ranking = df[["file", "Aciertos", "Fallos"]].sort_values(by="Fallos", ascending=False)

    # =========================
    # Estadsticas por campo
    # =========================
    stats_por_campo = df.drop(columns=["file", "Aciertos", "Fallos"]).agg(
        ["sum", "count"]
    ).T
    stats_por_campo.rename(columns={"sum": "Aciertos", "count": "Total"}, inplace=True)
    stats_por_campo["Fallos"] = stats_por_campo["Total"] - stats_por_campo["Aciertos"]
    stats_por_campo["% Acierto"] = (stats_por_campo["Aciertos"] / stats_por_campo["Total"]) * 100

    # =========================
    # Resumen global
    # =========================
    total_campos = stats_por_campo["Total"].sum()
    total_aciertos = stats_por_campo["Aciertos"].sum()
    total_fallos = total_campos - total_aciertos
    resumen = pd.DataFrame({
        "Mtrica": ["Total Comparaciones", "Total Aciertos", "Total Fallos", "% Acierto Global"],
        "Valor": [total_campos, total_aciertos, total_fallos, total_aciertos / total_campos * 100],
    })

    # =========================
    # Guardar en Excel
    # =========================
    with pd.ExcelWriter(file_excel, engine="openpyxl") as writer:
        df.to_excel(writer, sheet_name="Resultados Detallados", index=False)
        stats_por_campo.to_excel(writer, sheet_name="Por Campo")
        resumen.to_excel(writer, sheet_name="Resumen Global", index=False)
        ranking.to_excel(writer, sheet_name="Ranking Archivos", index=False)

    # =========================
    # Insertar Grficas
    # =========================
    wb = load_workbook(file_excel)

    # --- Grfica por campo ---
    ws_campos = wb["Por Campo"]
    chart1 = BarChart()
    chart1.title = "Aciertos y Fallos por Campo"
    chart1.x_axis.title = "Campo"
    chart1.y_axis.title = "Cantidad"

    data = Reference(ws_campos, min_col=2, max_col=3, min_row=1, max_row=ws_campos.max_row)
    cats = Reference(ws_campos, min_col=1, min_row=2, max_row=ws_campos.max_row)
    chart1.add_data(data, titles_from_data=True)
    chart1.set_categories(cats)
    ws_campos.add_chart(chart1, "G2")

    # --- Grfica resumen global (solo aciertos vs fallos) ---
    ws_resumen = wb["Resumen Global"]
    chart2 = PieChart()
    chart2.title = "Distribucin Global Aciertos vs Fallos"

    data = Reference(ws_resumen, min_col=2, min_row=3, max_row=4)
    cats = Reference(ws_resumen, min_col=1, min_row=3, max_row=4)

    chart2.add_data(data, titles_from_data=False)
    chart2.set_categories(cats)

    chart2.dLbls = DataLabelList()
    chart2.dLbls.showVal = True
    chart2.dLbls.showPercent = True

    ws_resumen.add_chart(chart2, "E5")

    wb.save(file_excel)
    files.download(file_excel)

    print(f" Archivo '{file_excel}' creado con tablas, ranking y grficas")

